import React, {Component} from 'react';
import {Button} from 'semantic-ui-react';

export default class VotePopup extends Component{

    handleClickClose = () => {
        this.props.toggle();
    }

    render(){
        return(

            <div className="votepopup">
                <div className="votepopup_content">

                    <span className="close" onClick={this.handleClickClose}>
                        &times;
                    </span>

                    <h3>Confirm Vote</h3>
                    <Button>Confirm</Button>







                </div>
            </div>
        )
    }
}
